import React from 'react';
import Card from '../components/Card';

const sample = [
  {
    id: 1,
    title: 'Ahsan Manzil (Pink Palace)',
    desc: 'A beautifully restored Mughal-style palace museum by the Buriganga River.',
    duration: '1–2 hours',
    price: 'Free',
    rating: 4.6,
    img: 'https://upload.wikimedia.org/wikipedia/commons/1/16/Ahsan_Manzil-Front_View.jpg'
  },
  {
    id: 2,
    title: 'Lalbagh Fort',
    desc: 'A historic 17th-century Mughal fortress featuring gardens and gateways.',
    duration: '1–3 hours',
    price: '৳ 20',
    rating: 4.5,
    img: 'https://images.pexels.com/photos/17830385/pexels-photo-17830385.jpeg'
  },
  {
    id: 3,
    title: 'Shilpakala Academy',
    desc: 'A vibrant cultural center hosting theatre, dance and art exhibitions.',
    duration: '1–2 hours',
    price: '৳ 100 – 300',
    rating: 4.7,
    img: 'https://www.alamy.com/stock-photo/bangladesh-shilpakala-academy.html'
  },
  {
    id: 4,
    title: 'Prana Yoga Studio',
    desc: 'Boutique yoga studio offering Vinyasa flow classes and workshops.',
    duration: '1–1.5 hours',
    price: '৳ 600 – 1,200',
    rating: 4.7,
    img: 'https://www.istockphoto.com/en/photo/hatha-yoga-at-home-gm1472059271-502509700'
  },
  {
    id: 5,
    title: 'Cooking Class',
    desc: 'Hands-on Bengali cooking class teaching biryani, bhorta and sweets.',
    duration: '2–3 hours',
    price: '৳ 800 – 1,200',
    rating: 4.6,
    img: 'https://www.istockphoto.com/en/photo/cooking-master-class-pasta-preparing-hands-gm1268900953-372515610'
  },
  {
    id: 6,
    title: 'Purbachal Cycling Trail',
    desc: 'A scenic lakeside cycling route with smooth paths and fresh air.',
    duration: '1–2 hours',
    price: 'Free',
    rating: 4.5,
    img: 'https://www.istockphoto.com/en/photo/pov-mountain-biking-family-riding-on-forest-trail-gm1281756222-379697769'
  }
];

export default function Browse() {
  return (
    <div className="page">
      <div className="page-header">
        <div className="brand">
          <h2 className="brand-heading">Browse All Experiences</h2>
        </div>
      </div>

      <div className="grid">
        {sample.map(item => (
          <Card key={item.id} {...item} />
        ))}
      </div>
    </div>
  );
}
